import React, { useState } from 'react';
import './Dashboard.css'; // Import a CSS file for styling
import Man from '../Dashboard/man.svg'; // Correct import path for the SVG
import { Doughnut } from 'react-chartjs-2'; // Import Doughnut chart from react-chartjs-2
import Chart from 'chart.js/auto'; // Import Chart.js

const chartData = {
  labels: ['Leadership', 'Communication', 'Negotiation'],
  datasets: [
    {
      data: [70, 10, 20],
      backgroundColor: ['#97DDA8', '#F6A3B6', '#FDECD8'],
      borderColor: ['white'],
      borderWidth: 4,
    },
  ],
};

const centerTextPlugin = {
  id: 'centerTextPlugin',
  beforeDraw: (chart) => {
    const { ctx, chartArea: { width, height } } = chart;
    ctx.save();
    ctx.shadowColor = 'rgba(0, 0, 0, 0.10)';
    ctx.shadowBlur = 10;
    ctx.shadowOffsetX = 2;
    ctx.shadowOffsetY = 2;

    chart.getDatasetMeta(0).data.forEach((segment) => {
      segment.draw(ctx);
    });

    ctx.restore();
    ctx.font = '30px Lexend Deca';
    ctx.fillStyle = '#000';
    ctx.textAlign = 'center';
    ctx.textBaseline = 'middle';
    const text = '23';
    ctx.fillText(text, width / 2, height / 2 + 5);
  }
};

const Dashboard = () => {
  const [percentage, setPercentage] = useState(25);

  return (
    <div className="dashboard-container">
      <div className="text1">
        <h2>Focus skills</h2>
      </div>
      <div className="line1">
        <p>Organisational</p>
      </div>
      <div className="line2">
        <p>Individual</p>
      </div>

      {/* First Card */}
      <div className="card">
        <h2>Short term Goal</h2>
        <p>Level up from Intermediate to</p>
        <p>Advance level SDR</p>
        <img src={Man} alt="Man" className="man-image" />
      </div>

      {/* Second Card with Donut Chart */}
      <div className="card1">
        <h2>Training Hours</h2>
        <div className="chart-container">
          <Doughnut data={chartData} plugins={[centerTextPlugin]} options={{
            cutout: '65%',
            plugins: {
              legend: {
                position: 'right',
                labels: {
                  boxWidth: 20,
                  padding: 20,
                  font: {
                    size: 14,
                  },
                },
                padding: {
                  right: 100,
                }
              }
            }
          }} />
        </div>
      </div>

      {/* New Card with Progress Bar */}
      <div className="card5">
        <h2>Training progress</h2>
        <div className="progress-bar-container">
          <div className="progress-bar-fill" style={{ width: `${percentage}%` }}></div>
          <div className="progress-bar">
            <span className="progress-text">{percentage}% completed</span>
          </div>
        </div>
      </div>

      <div className="card2">
        <p>Communication</p>
      </div>
      <div className="card3">
        <p>Leadership</p>
      </div>
      <div className="card4">
        <p>Negotiation</p>
      </div>
      <div className="card6">
        <h2>Actions</h2>
        <p>Complete preparation ahead of Quarterly skills call</p>
        <p>Review & Approve suggested training schedule</p>
        <p>Interactive Learning Resources.</p>
      </div>
      <footer className="footer">
        <p>© Copyrights Protected by Vekla</p>
      </footer>
    </div>
  );
};

export default Dashboard;
